John Dahlback - Nothing Is For Real (Mark Knight Remix) [7:30]

17.1MB

320KBps Digital Release.

Previously posted only on my personal music blog.



Reading both the names &quot;John Dahlback&quot; and &quot;Mark Knight&quot; in the same sentence can only mean pure quality.

If you aren&amp;#039;t familiar with either artist, I am extremely confident your curiosity will be rewarded with a much enhanced definition of cutting-edge electro.  This production may have been released in November of 2005, but it is still standing extremely strong in the current climate of varying styles of electro.

There is simply nothing that needs saying for those in the know.


Please stay tuned for today&amp;#039;s fine selection of Mark Knight remixes and productions.



Enjoy and please seed.


